content="Do you know, I was so angry, Kitty," Alice went on as soon as they were comfortably settled again, "when I saw all the mischief you had been doing, I was very nearly opening the window, and putting you out into the snow! And you'd have deserved it, you little mischievous darling! What have you got to say for yourself? Now don't interrupt me!" she went on, holding up one finger. "I'm going to tell you all your faults. Number one: you squeaked twice while Dinah was washing your face this morning."

